// CarouselComponent.jsx
import React from 'react';
import { Carousel } from 'react-bootstrap';
import carousel from "../../asstes/images/iplslider1.jpg";
import carousel1 from "../../asstes/images/iplslider2.jpg";
import carousel2 from "../../asstes/images/iplslider4.jpg";


const CarouselComponent = () => {
  return (
    <Carousel fade>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={carousel}
          alt="First slide"
          width="40" height="500"
        />
        <Carousel.Caption>
          <h3>MI VS RC</h3>
          <p>The Mumbai Indians (MI) and Rajasthan Royals (RR) are two iconic franchises in the Indian Premier League. MI, based in Mumbai, is one of the most successful teams with five IPL titles, while RR, based in Jaipur, won</p>
        </Carousel.Caption>
      </Carousel.Item>

      <Carousel.Item>
        <img
          className="d-block w-100"
          src={carousel1}
          alt="Second slide"
          width="40" height="500"
        />
        <Carousel.Caption>
          <h3>Second Slide Label</h3>
          <p>Some placeholder content for the second slide.</p>
        </Carousel.Caption>
      </Carousel.Item>

      <Carousel.Item>
        <img
          className="d-block w-100"
          src={carousel2}
          alt="Third slide"
          width="40" height="500"
        />
        <Carousel.Caption>
          <h3>Third Slide Label</h3>
          <p>Some placeholder content for the third slide.</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
};

export default CarouselComponent;
